import React from 'react';
import Search from './search';
import Box from './box';


class MyApp extends React.Component{
    render(){
        return(
            <div style={{backgroundImage:"URL(https://www.priceline.com/home/public/assets/images/photos/pcln-hp-hero-mountain-lounge.jpg)", height: "100vh"}}>


                <Box
                 head="Save more on your next hotel" 
                 sub="Thousands of deals made every day " 
                 footer="Get up to $1,000 to spend at sea when you"
                 footer-b=" book a cruise with Priceline."/>



            </div>
        );
    }
}

export default MyApp;
